import React from "react";
import Cities from "./Cities";

const Confirmation=(props)=>{
    return(
        <div style={{height:550,marginTop:50}}className="card">
            <div style={{marginLeft:100}}className="columns">
                <Cities data={props.data}/>
            </div>
            <div className="container">
                <button className="button"><a href="/calc">Yep, that's right!</a></button>
                <button className="button"><a href="/">No, I meant someplace else</a></button>
            </div>
        </div>
    )
}

export default Confirmation
